        "print(\"Features in the dataset:\")\n",
        "print(train.columns.tolist())\n",
        "print(test.columns.tolist())\n",
        "\n",
        "# 2. Check data types of each feature\n",
        "print(\"\\nFeature Data Types:\")\n",
        "print(train.dtypes)\n",
        "print(test.dtypes)\n",
        "\n",
        "# 3. Get detailed info (non-null counts and types)\n",
