    {
      "cell_type": "markdown",
      "source": [
        "**1.What is the difference between precision and recall?**"
      ],
      "metadata": {
        "id": "4FCvYU--k5i5"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "Precision and recall are two key metrics used to evaluate the performance of classification models, especially in situations with imbalanced data. Precision measures the accuracy of the positive predictions — it is the ratio of true positive predictions to the total number of positive predictions made (true positives + false positives). In other words, precision tells us how many of the predicted positives are actually correct. Recall, on the other hand, measures the model’s ability to identify all actual positive cases — it is the ratio of true positive predictions to the total number of actual positives (true positives + false negatives). While precision focuses on the quality of positive predictions, recall focuses on their completeness. There’s often a trade-off between the two, and the balance depends on the specific goals of the task."
      ],
      "metadata": {
        "id": "mQawqvtNk6bD"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "**2.What is cross-validation, and why is it important in binary classification?**"
      ],
      "metadata": {
        "id": "lAp-QEjDlKge"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "Cross-validation is a statistical technique used to assess how well a machine learning model generalizes to an independent dataset. In binary classification, where the goal is to classify data into one of two classes, cross-validation is especially important for ensuring that the model performs consistently and isn’t overfitting to the training data.\n",
        "\n",
        "The most common form is k-fold cross-validation, where the dataset is divided into k equal parts (folds). The model is trained on k−1 folds and tested on the remaining one. This process is repeated k times, with each fold used once as the test set. The performance metrics (such as accuracy, precision, recall, etc.) are averaged over all k runs.\n",
        "\n",
        "Cross-validation is important in binary classification because it provides a more reliable estimate of model performance across different subsets of data, helps detect overfitting or underfitting, and ensures the model’s robustness, especially when data is limited or imbalanced."
      ],
      "metadata": {
        "id": "UirEqv5slh1h"
      }
    },
